results:
  Age:
    code:
    - - .isNonNegative('Age')
      - Passed
  Medical Condition:
    code:
    - - .isContainedIn('Medical Condition', ['Diabetes', 'Asthma', 'Obesity', 'Hypertension',
        'Arthritis', 'Cancer'])
      - Passed
  Name:
    code:
    - - .isComplete('Name')
      - Passed
  id:
    code:
    - - .isComplete('id')
      - Passed
    - - .isNonNegative('id')
      - Passed
    - - .isUnique('id')
      - Passed
